def process_graph_queries(n, m, queries):
    e = dict()
    same = 0
    diff = 0
    res = []
    for query in queries:
        c = query[0]
        if c == '+':
            u = int(query[1])
            v = int(query[2])
            c_char = query[3]
            z = e.get((v, u), None)
            if z == c_char:
                same += 1
            elif z is not None:
                diff += 1
            e[u, v] = c_char
        elif c == '-':
            u = int(query[1])
            v = int(query[2])
            c_char = e[u, v]
            del e[u, v]
            z = e.get((v, u), None)
            if z == c_char:
                same -= 1
            elif z is not None:
                diff -= 1
        else:
            k = int(query[1])
            if k % 2 == 1:
                if diff + same > 0:
                    res.append('YES')
                else:
                    res.append('NO')
            elif same > 0:
                res.append('YES')
            else:
                res.append('')
    return res
